  02> WILLIAMS, Deborah Mary
  b 04.10.1955
  Deborah b. at Waipiro Bay. Address: 206 Whitaker Street, Gisborne.
  Deborah was educated at Queenswood School, Woodford House and Massey University (DipHort). She
  travelled overseas and worked for several months for John Stevens Safaris in Zimbabwe. She is now
  living at Manutuke, having completed an office and computer course.
  3> WILLIAMS, Natalie Margot m on 19.01.1979 to STEPHEN, John McKenzie
  b 28.12.1956
  b 07.12.1953
  Margot b. at Waipiro Bay, Te Puia and m, at "Matahiia" station, Ruatoria. John, slo Alfred James
  Stephen and Patricia George Young, b. at Lower Hutt. Address: 43 Dalrymple Road, Gisborne.
  Margot is a kindergarten teacher and special needs teacher at primary level. Since finishing school
  at St Patrick's College, Silverstream, John has been leasing a cropping/bull/sheep unit as well as
  a dairy farm in the South Wairarapa. He has also worked in shearing gangs and done casual
  labouring.
